import logo from './logo.svg';
import './App.css';
import { AuthProvider } from './web/AuthContext';
import Logout from './web/cmpts/Logout';
import Login from './web/cmpts/Login';


function App() {
  return (
    <div className="App">
      <AuthProvider>
        <Login />
        <Post />
        <Form />
        <Logout />
      </AuthProvider>
    </div>
  );
} export default App;
